#include <gtest/gtest.h>
#include "subarray_sums_divisible_by_k.h"

TEST(NumArray, subarraysDivByK) {
  int a[] = {4,5,0,-2,-3,1};
  vector<int> vec(a, a + sizeof(a)/sizeof(a[0]));
  Solution solution;
  EXPECT_EQ(solution.subarraysDivByK(vec, 5), 7);
}

TEST(NumArray, subarraysDivByK2) {
  int a[] = {2};
  vector<int> vec(a, a + sizeof(a)/sizeof(a[0]));
  Solution solution;
  EXPECT_EQ(solution.subarraysDivByK(vec, 6), 0);
}

